import "./profile.css";
import Card from "../../components/Card/Card";
import { useAuth } from "../../context&hook/useAuth";
const Profile = () => {
    const { user } = useAuth(); 

    return (    
        <div className="profile-main">   
        <Card title = {user}></Card>
        </div>
    )
}



export default Profile;
